import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const DoctorDashboard = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <div className="container">
      <div className="dashboard">
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <h1>Welcome, Dr. {user?.name}!</h1>
          <button className="btn btn-secondary" onClick={handleLogout}>
            Logout
          </button>
        </div>
        
        <p style={{ color: '#666', marginTop: '10px' }}>Email: {user?.email}</p>
        <p style={{ color: '#666' }}>Doctor ID: {user?.doctorId}</p>

        <div className="dashboard-grid">
          <div className="dashboard-card">
            <h3>üìÖ Scheduled Appointments</h3>
            <p>View and manage your appointments</p>
          </div>

          <div className="dashboard-card">
            <h3>‚úçÔ∏è Write Blog</h3>
            <p>Share your medical knowledge</p>
          </div>

          <div className="dashboard-card">
            <h3>üë§ Profile</h3>
            <p>Update your information</p>
          </div>

          {/* <div className="dashboard-card">
            <h3>üìä Statistics</h3>
            <p>View your performance metrics</p>
          </div> */}
        </div>

        <div style={{ marginTop: '30px', padding: '20px', background: '#e3f2fd', borderRadius: '10px', border: '2px solid #2196f3' }}>
          <h3>Login Successful!</h3>
          {/* <p>Your authentication was successful and you're now logged into your doctor dashboard.</p> */}
          <p style={{ marginTop: '10px', color: '#666' }}>
            You can now manage appointments, write health blogs, and update your profile information.
          </p>
        </div>
      </div>
    </div>
  );
};

export default DoctorDashboard;
